import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Footer from '../Footer';
import Events_Button from '../Events_Button';
import { Button } from './Button';



function Events() {
  return (
    <>
      <Cards />
      <Events_Button className='btns'
         buttonStyle='btn--primary' 
         buttonSize='btn--large'>
           Let's get started! <i class="fas fa-chevron-right"></i> </Events_Button>





      <Footer />
    </>
  );
}


export default Events;
